import {
  Container,
  CssBaseline,
  Grid,
  Paper,
  Typography,
} from "@material-ui/core";
import { Icon } from "@material-ui/core";
import React from "react";
import footerStyles from "./FooterStyle";
import footerLogo from "../../images/CourseFluxlogo.png";
import PhoneAndroidRoundedIcon from "@material-ui/icons/PhoneAndroidRounded";
import EmailRoundedIcon from "@material-ui/icons/EmailRounded";
import LocationOnRoundedIcon from "@material-ui/icons/LocationOnRounded";

const Footer = () => {
  const classes = footerStyles();
  return (
    <>
      <CssBaseline />
      <Paper className={classes.footerContainer}>
        <Container>
          {/* <Typography variant="h5" color="textSecondary">
            This is footer container
          </Typography> */}
          <Grid justify="space-evenly" container spacing={3}>
            <Grid alignItems="center" item xs={12} lg={4}>
              <img
                className={classes.footerImg}
                src={footerLogo}
                alt="footerLogo"
              />
              <Typography
                className={classes.copyrightText}
                variant="subtitle"
                color="primary"
              >
                Â© Copyright 2021. All rights reserved by Course Flux
              </Typography>
            </Grid>

            <Grid item xs={12} lg={4}>
              <Typography
                align="center"
                variant="h4"
                component="h2"
                color="primary"
              >
                Contact Us
              </Typography>

              <Grid container spacing={2}>
                <PhoneAndroidRoundedIcon
                  color="primary"
                  fontSize="large"
                ></PhoneAndroidRoundedIcon>
              </Grid>
            </Grid>
            <Grid item xs={12} lg={4}>
              <Typography
                align="center"
                variant="h4"
                component="h2"
                color="primary"
              >
                Subscribe to Our Newsletter
              </Typography>
            </Grid>
          </Grid>
        </Container>
      </Paper>
    </>
  );
};

export default Footer;
